column8:
テーブルに”ピタッ”と密着！！<br>
すべりにくいシリコーン製 (^.^)b<br>
お食事の際の食べこぼしに安心☆彡<br>
テーブルの汚れを防ぎます (*^_^*)<br>
汚れてもサッと丸洗いできて、お手入れも簡単♪<br>
<br>
・ポケットが食べこぼしをキャッチ<br>
・液体の広がりを防ぐフチ付き<br>
・くるっと丸めて、コンパクト収納<br>
・ひっかけ穴があるので、吊るしてしっかり乾燥<br>
・身体にやさしいカーブ形状<br>
<br>
○商品サイズ：約 横500×縦415×厚さ34mm<br>
<br>
≪品質表示≫<br>
シリコーン／耐熱温度230度<br>
<br>【Made in China】<BR>

<style>
/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
	width: 320px;
	height: 70px;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/cart_in.gif) #ff8003 no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#rakutenLimitedId_aroundCart td.inventory {
	padding:10px 5px;
	vertical-align:middle;
	height: 2.4em;
	display:table-cell;
}

#rakutenLimitedId_aroundCart .inventory input {
	background:none !important;
	border:1px solid #cfcfcf;
	width:1.6em;
	height:1.6em;
	margin:0;
}



/*個数テキスト*/
#rakutenLimitedId_aroundCart .unit {
	font-size:16px;
}

/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
	border:solid #ccc 1px;
	background:#fff!important;
	width:30px;
	height:30px;
	cursor:auto;
	padding:7px 7px 7px 3px;
	text-indent: 0px;
	overflow: hidden;
	display:inline;
	font-size:16px;
}

/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
	width: 320px;
	height: 43px;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/contact_item.gif) #beb9b4 no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#serviceTableSml .favorite {
	display:block;
	width: 320px;
}

#serviceTableSml .favorite .bookmarkArea div{
	width: 320px!important;
}

#serviceTableSml .favorite .bkm a {
	width: 320px!important;
	height: 144px!important;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/like_item.gif) #d8fbfd no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent:-150%;
	margin: 5px 0 0 0;
	display:block;
}

input[type="radio"] {
    border: 0px;
}

.catch_copy,
.item_name {
text-align:left;
}

.commonbig-area h3 {
	text-align:center;
}

.commonbig-area ul {
	width:730px;
	list-style:none;
	margin:0;
	padding:0;
}

.commonbig-area ul li {
	width:240px;
	float:left;
	margin:0 5px 5px 0;;
	padding:0;
}

.commonbig-area ul li.nospace {
	margin-right:0;
}

.center {
  text-align: center;
}
.coupon_box {
  margin-top: 50px;
}
.coupon li {
  float: left;
  width: 25%;
  list-style: none;
  margin-top: 25px;
}
.coupon li img {
  width: 90%;
  height: auto;
}

.category {
	margin:8px 0;
	padding: 30px 8px;
	background:#374CF0;
	color:white;
	font-size: xx-large;
}



</style>

<style TYPE="text/css">

/*項目選択肢のフォント変更*/
td.inventory font{
	font-size:10px;color:#666666;
	}

</style>



<style type="text/css">
/*項目選択肢の色を変える*/
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"]{
font-family:ヒラギノ角ゴ Pro W3,Hiragino Kaku Gothic Pro,メイリオ,Meiryo,ＭＳ Ｐゴシック,sans-serif;
background:#FFF;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] td.inventory_choice_name {
background:#777;
padding:10px 5px;
border: 1px solid #555;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] span.inventory_choice_name {
color:#FFF;
font-size:10px;
letter-spacing:1px;
font-family:ヒラギノ角ゴ Pro W3,Hiragino Kaku Gothic Pro,メイリオ,Meiryo,ＭＳ Ｐゴシック,sans-serif;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] td.inventory{
background:#EEE;
padding:10px 5px!important;
border: 1px solid #555;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] td.inventory font{
font-size:10px;
}
</style>









